var smallestSubarrays = function(nums) {
  // variable to store the length of the input array
  let n = nums.length;
  // variable to store the result
  let result = Array(n).fill(0)
  // loop through each number in the input array
  for (let i = 0; i < n; i++) {
      // variable to store the maximum bitwise OR value
      let maxOR = 0;
      // variable to store the length of the minimum sized subarray with maximum bitwise OR value
      let length = 0;
      // variable to store the current bitwise OR value
      let currOR = 0;
      // loop through each number after the current number
      for (let j = i; j < n; j++) {
          // update the current bitwise OR value
          currOR |= nums[j];
          // if the current bitwise OR value is greater than the maximum bitwise OR value
          if ((currOR > maxOR) ) {
              // update the maximum bitwise OR value
              maxOR = currOR;
              // update the length of the minimum sized subarray with maximum bitwise OR value
              length = j - i + 1;
          }

          if (currOR === 0 && maxOR ===0) length = 1
      }
      // store the length of the minimum sized subarray with maximum bitwise OR value for the current number
      result[i] = length;
  }
  // return the result
  return result;
};

